import React from "react";

function List({ task, handleModify }) {
  // console.log(task);
  return (
    <>

        <tr key={index} className="todo-item">
          <td>{todo.text}</td>
          <td>{todo.status}</td>
          <td>
            {/* 수정, 완료, 삭제 버튼 */}
            <button className="btn btn-warning btn-sm" onClick={handleModify}>
              <i className="bx bx-edit-alt bx-bx-xs"></i>
            </button>
            <button className="btn btn-success btn-sm">
              <i className="bx bx-check bx-xs"></i>
            </button>
            <button className="btn btn-error btn-sm">
              <i className="bx bx-trash bx-xs"></i>
            </button>
          </td>
        </tr>;
    </>
  );
}

export default List;
